import React from 'react';
import { Grid, Paper, Avatar, Typography, TextField, Button } from '@material-ui/core';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';
const Signup = () => {
    const paperStyle = { padding: "30px 20px", width: 340, margin: "80px auto" }
    const avatarStyle = { backgroundColor: '#1c4c74' }
    const btnStyle={margin:''}

    return (
        <Grid>
            <Paper elevation={20} style={paperStyle}>
                <Grid align='center'>
                    <Avatar style={avatarStyle}>
                        <AddCircleOutlineIcon />
                    </Avatar>
                    <h2 style={btnStyle}>Sign Up</h2>
                    <Typography variant='caption'>Please fill the details to create an account</Typography>
                </Grid>
                <form>
                    <TextField fullwidth label='Name' placeholder='Enter Your Name...'/>
                    <TextField fullwidth label='Email' />
                    <TextField fullwidth label='Phone Number' />
                    <TextField fullwidth label='Password' />
                    <TextField fullwidth label='Confirm Password' />
                    {/* <Button type='submit' variant='contained' color='primary'>Sign Up</Button> */}
                </form>
            </Paper>
        </Grid>
    )

}


export default Signup;
